import React from 'react';
import Submitbtn from '../Submitbtn';

const Deletebox  = ({user, onClick}) => {
    if (user.admin) {
        return(
            <td>
                <Submitbtn value='Delete' onClick={onClick} />
            </td>
        )
    } else {
        return (
            <div></div>
        )
    }

}

export default Deletebox;
